import React from 'react'
import { Bar, Pie, PieChart } from 'recharts'
function Barchart() {
   
  {
    const data = [
      {name: "Male",value:10},
      {name:"Female",value:15},
      {name:"Required",value:3},
    ];
    return(
      <div className='chart'>
    <h1>genderchart</h1>
    <PieChart width={400} height={500}></PieChart>
    <Pie
    dataKey="value"
    cx={200}
    cy={250}
    outerRadius={70}
    fill='orange'
    label/>
      </div>
    )
  }
}


export default Barchart
